import React from "react";
import {
    AppBar, Bix
} from "@mui/material"
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="navbar">
      <button>HOME</button>
      <button>CONSULTS</button>
      <button>PROFILE</button>
      <button>LOG OUT</button>
    </div>
  );
};

export default Navbar;
